class TestSolutionTree(unittest.TestCase):

    def test_is_a_result(self):
        tree = SolutionTreeMapper.parse(json.loads(tree_byte_arr))
        self.assertTrue(tree.is_a_result(Expression(exercise.result)))

    def test_is_a_result_steps_are_not_results(self):
        tree = SolutionTreeMapper.parse(json.loads(tree_byte_arr))
        middle_step_is_result = False
        for i in range(0, len(exercise.steps) - 2):
            step = exercise.steps[i]
            expression = Expression(step)
            middle_step_is_result = middle_step_is_result or tree.is_a_result(expression)
        self.assertFalse(middle_step_is_result)

    def test_is_a_result_pre_simplification_steps_are_results(self):
        tree = SolutionTreeMapper.parse(json.loads(tree_byte_arr))
        self.assertTrue(tree.is_a_result(Expression(exercise.steps[-1])))

